  [],\n\t\"revision_timestamp\": \"2016-02-22T19:33:49.099512\",\n\t\"name\": \"ghrsst-level-4-mur-north-america-regional-foundation-sea-surface-temperature-analysis-gds-versi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A Group for High Resolution Sea Surface
  Temperature (GHRSST) Level 4 sea surface temperature analysis produced as a retrospective
  dataset at the JPL Physical Oceanography DAAC using wavelets as basis functions
  in an optimal interpolation approach on a regional 0.011 degree grid over the oceans
  off North and Central America (62N- 20S, 165W - 30W). The Multiscale Ultrahigh Resolution
  (MUR) L4 analysis is based upon nighttime GHRSST L2P skin and subskin SST observations
  from several instruments such as: the NASA Advanced Microwave Scanning Radiometer-EOS
  (AMSRE), and the Moderate Resolution Imaging Spectroradiometer (MODIS) on the NASA
  Aqua and Terra platforms. The ice concentration data are from the archives at the
  EUMETSAT Ocean and Sea Ice Satellite Application Facility (OSI SAF) High Latitude
  Processing Center.nnThis data set is funded by the NASA MEaSUREs program (http://earthdata.nasa.gov/our-community/community-data-system-programs/measures-projects),
  and created by a team led by Dr. Toshio Chin from JPL.\",\n\t\"license_title\":
